// ==UserScript==
// @name         Hijri to Gregorian Converter
// @version      1.0
// @description  Convert Hijri to Gregorian on Google search results
// @author       Ahmed Alahmadi
// @match        https://www.google.com/*
// @icon         data:image/png;base64,
// @require      https://ajax.googleapis.com/ajax/libs/jquery/2.1.0/jquery.min.js
// @require      https://gist.github.com/raw/2625891/waitForKeyElements.js
// @require      https://momentjs.com/downloads/moment.min.js
// @require      https://momentjs.com/downloads/moment-with-locales.min.js
// @require      https://raw.githubusercontent.com/xsoh/moment-hijri/master/moment-hijri.js
// ==/UserScript==

moment.locale('en-US');
waitForKeyElements("span.f:contains('AH')", convertTimezone);
waitForKeyElements("div.wrBvFf:contains('AH')", convertTimezone);
waitForKeyElements("div.fG8Fp.uo4vr:contains('AH')", convertTimezone);
function convertTimezone(jNode) {
    var oldDate = jNode.text().substring(0, jNode.text().indexOf('AH') + 'AH'.length); //remove text after AH string
    array = oldDate.split(' ');
    if (array.length == 5) {
        [month, month2, day, year] = array;
        month = (month + ' ' + month2);
    }
    else {
        [month, day, year] = array;
    }
    switch (month) {
        case "Muh.":
            monthNumber = "1";
            break;
        case "Saf.":
            monthNumber = "2";
            break;
        case "Rab. I":
            monthNumber = "3";
            break;
        case "Rab. II":
            monthNumber = "4";
            break;
        case "Jum. I":
            monthNumber = "5";
            break;
        case "Jum. II":
            monthNumber = "6";
            break;
        case "Raj.":
            monthNumber = "7";
            break;
        case "Sha.":
            monthNumber = "8";
            break;
        case "Ram.":
            monthNumber = "9";
            break;
        case "Shaw.":
            monthNumber = "10";
            break;
        case "Dhuʻl-Q.":
            monthNumber = "11";
            break;
        case "Dhuʻl-H.":
            monthNumber = "12";
            break;
        default:
            monthNumber = "Error";
    }
    day = day.substring(0, day.indexOf(',') + 0);
    date = (day + '/' + monthNumber + '/' + year);
    m = moment(date, 'iD/iM/iYYYY');
    var newDate = m.format('D/M/YYYY');
    if (jNode.text().includes("Uploaded by")) {
        jNode.text(newDate + ' ' + '·' + ' ' + jNode.text().substring(jNode.text().indexOf('·') + '·'.length));
    }
    else if (jNode.text().includes("—")) {
        jNode.text(newDate + ' ' + jNode.text().substring(jNode.text().indexOf('—')));
    }
    else {
        jNode.text(newDate);
    }
}
